const strings = {

	'null': '',
	'dict': `var x = {};x[1]=1;`,
	'if': `if(true){console.log('true')}`,
	'expressive': `var x = (function(){return 1;})()`,
	'literal': '1',
	'expression': '1 + 1',
	'while': 'while(true){}',

	'whilefor': `
		while(true){
			for (let i = 0; i < y; i++){}
		}`,

	'variable': `
		let x = 10;
		const y = x;
		var z = x + y;
		`,

	'block': '{}',
	'function': `function hello(){
		console.log ('foo bar');
	}`,
	'break': 'while(true){break;}',
	'continue': 'while(true){continue;}',

	'fib': `
		function fib(x) {
			return x == 1 || x == 0? x : f(x - 1) + f(x -2);
		}`,

	'sum':`
	  	var N = 100;
	  	var acc = 0;
	  	for (let i = 0; i < N; i++){
	  		acc += i;
	  	}
	  	console.log(acc);`,

	'if':`
		if(true){
			console.log ("yea that was true");
		}`
};

const vals = {};

function init() {

	for (let key in strings){
		vals[key] = acorn.parse(strings[key]).body;
	}
};

init();

// Unit Tests

function testBlackList(){

	// No blacklist violations

	assert(blackList(vals.null,listCommonNameToFormalName(['while','for'])));
	assert(blackList(vals.literal, listCommonNameToFormalName(['var','while'])));

	assert(blackList(vals.dict, listCommonNameToFormalName(['for','while'])));
	assert(blackList(vals.if, listCommonNameToFormalName(['return','while'])));
	assert(blackList(vals.expressive, listCommonNameToFormalName(['for','while'])));

	assert(blackList(vals.expression, listCommonNameToFormalName(['var','for','if'])));
	assert(blackList(vals.while, listCommonNameToFormalName(['return','for', 'expression'])));

	assert(blackList(vals.block, listCommonNameToFormalName(['var'])));
	assert(blackList(vals.function, listCommonNameToFormalName(['while','for'])));
	assert(blackList(vals.break, listCommonNameToFormalName(['var','for'])));

	assert(blackList(vals.continue, listCommonNameToFormalName(['return','for'])));
	assert(blackList(vals.fib, listCommonNameToFormalName(['var','while'])));
	assert(blackList(vals.sum, listCommonNameToFormalName(['while','continue'])));

	// Blacklist Violations

	assert(!blackList(vals.literal, ['ExpressionStatement']));
	assert(!blackList(vals.expression, listCommonNameToFormalName(['expression'])));
	assert(!blackList(vals.block, listCommonNameToFormalName(['block'])));
	assert(!blackList(vals.function, listCommonNameToFormalName(['function','for'])));

	assert(!blackList(vals.dict, listCommonNameToFormalName(['for','dict'])));
	assert(!blackList(vals.if, listCommonNameToFormalName(['if','while'])));
	assert(!blackList(vals.expressive, listCommonNameToFormalName(['expressive','while'])));

	assert(!blackList(vals.break, listCommonNameToFormalName(['var','break'])));
	assert(!blackList(vals.continue, listCommonNameToFormalName(['continue','for'])));
	assert(!blackList(vals.fib, listCommonNameToFormalName(['var','return','function'])));
	assert(!blackList(vals.sum, listCommonNameToFormalName(['var','expression'])));

	// Long Str

	if (TEST_LONG_STR){
		assert(blackList(lib.parse(LONG_STR).body, listCommonNameToFormalName(['expressive']) ))
		console.log("done")

	}

};


function testwhiteList(){

	// No whitelist violations

	assert(whiteList(vals.null,listCommonNameToFormalName([])));
	assert(whiteList(vals.literal, listCommonNameToFormalName(['expression'])));
	assert(whiteList(vals.while, listCommonNameToFormalName(['while'])));
	assert(whiteList(vals.whilefor, listCommonNameToFormalName(['while','for'])));

	assert(whiteList(vals.block, listCommonNameToFormalName(['block'])));
	assert(whiteList(vals.function, listCommonNameToFormalName(['function'])));
	assert(whiteList(vals.break, listCommonNameToFormalName(['break'])));

	assert(whiteList(vals.continue, listCommonNameToFormalName(['continue'])));

	assert(whiteList(vals.fib, listCommonNameToFormalName(['return','cond'])));

	assert(whiteList(vals.sum, listCommonNameToFormalName(['var','for'])));

	// whiteList Violations

	assert(!whiteList(vals.literal, ['expression', 'var']));
	assert(!whiteList(vals.expression, listCommonNameToFormalName(['while'])));
	assert(!whiteList(vals.block, listCommonNameToFormalName(['break'])));
	assert(!whiteList(vals.function, listCommonNameToFormalName(['function','for', 'continue'])));

	assert(!whiteList(vals.break, listCommonNameToFormalName(['var','while', 'break', 'for', 'if'])));
	assert(!whiteList(vals.continue, listCommonNameToFormalName(['continue','for', 'var'])));
	assert(!whiteList(vals.fib, listCommonNameToFormalName(['var','return', 'break'])));
	assert(!whiteList(vals.sum, listCommonNameToFormalName(['var','expression', 'continue'])));

	if (TEST_LONG_STR){
		assert(!whiteList(lib.parse(LONG_STR).body, listCommonNameToFormalName(['expression']) ));
		console.log("done")
	}

};


function testGeneralStructure(){

	// Positive Tests
	// Test 1

	const ifWhileFor = esprima.parse(
	`if(true)
		while(true){
			var x;
			for(let x = 0; x < 10; x++){
				console.log("fuck");
			}
		}`
	);

	assert(generalStructure(ifWhileFor.body, listCommonNameToFormalName(['if','while','for'])))

	// Test 2

	const ifWhileVar = esprima.parse(
	`if(true)
		while(true){
			var x;
			for(let x = 0; x < 10; x++){
				console.log("fuck");
			}
		}`
	);

	assert(generalStructure(ifWhileVar.body, listCommonNameToFormalName(['if','while','var'])))
	

	// Test 3

	const ifWhileForIf = esprima.parse(
	`if(true)
		while(true){
			var x;
			for(let x = 0; x < 10; x++){
				if(true){}
			}
		}`
	);

	assert(generalStructure(ifWhileForIf.body, listCommonNameToFormalName(['if','while','for','if'])))

	// Negative Tests

	// Test 1

	const ifWhileForNeg = esprima.parse(
	`while(true){
		var x;
		for(let x = 0; x < 10; x++){
			console.log("fuck");
			}
	}`);

	assert(!generalStructure(ifWhileForNeg.body, listCommonNameToFormalName(['if','while','for'])))

	// Test 2

	const ifWhileVarNeg = esprima.parse(
	`if(true)
		while(true){
			for(x in y){
				console.log("fuck");
			}
		}`
	);

	assert(!generalStructure(ifWhileVarNeg.body, listCommonNameToFormalName(['if','while','var'])))
	

	// Test 3

	const ifWhileForIfNeg = esprima.parse(
	`if(true)
		while(true){
			var x;
			for(let x = 0; x < 10; x++){
			}
		}`
	);


	assert(!generalStructure(ifWhileForIfNeg.body, listCommonNameToFormalName(['if','while','for','if'])))
	// Test 4

	const nothing = esprima.parse(
	`if(true)
		while(true){
			var x;
			for(let x = 0; x < 10; x++){
				console.log("fuck");
			}
		}`
	);

	assert(generalStructure(ifWhileFor.body, listCommonNameToFormalName([])));

	// Long Str

	if (TEST_LONG_STR){
		assert(!generalStructure(lib.parse(LONG_STR).body,listCommonNameToFormalName(['for'])));
		console.log("done");
	}


}

function testMatchTree(){

	// Test 1

	const simpleFunctionA = lib.parse(`
		function testNameOne (arg1, arg2){
		return 10; 
	}`)
	const simpleFunctionB = lib.parse(`
		function testNameTwo (alpha, beta){
			return 20;
		}
	`)

	assert(matchTree(simpleFunctionA.body, simpleFunctionB.body));

	// Test 2

	const simpleVarA = lib.parse(`var x = 10;`);
	const simpleVarB = lib.parse(`let x = 35;`);

	assert(matchTree(simpleVarA.body, simpleVarB.body));

	// Test 3

	const functionWhileA = lib.parse(`
			function goodbye (){
			while (false){
				console.log ("goodbye");
			}
		}`);

	const functionWhileB = lib.parse(`
			function hello (){
				while (true){
					console.log("hello");
			}
		}`);

	assert(matchTree(functionWhileA.body, functionWhileB.body));

	// Test 4

	const functionIfA = lib.parse(`
			function hello (){
			var cond = 20;
			if (x == 2){
				const x = 5;
			}
			return x;
	}`);

	const functionIfB = lib.parse(`
			function goodbye (){
				let cond = 10;
				if (cond == 21341234){
					const y = 10;
				}
				return y;}`
	);

	assert(matchTree(functionIfA.body, functionIfB.body));

	// Test 5

	const functionWhileIfA = lib.parse(`
			function hello (){
				while(x  > 10){
					if (false != []){
						console.log('fooooo');
					}
				}
			}`);

	const functionWhileIfB = lib.parse(`
			function goodbye (){
				while(x < 10){
					if (true == true){
						alert("barrrr");
					}
				}
			}`);

	assert(matchTree(functionWhileIfA.body, functionWhileIfB.body));

	// Test 6

	const functionWhileBreakVarIfA = lib.parse(`
			function hello (){
				while(true){
					break
					if (x){
						console.log ("hello world");
					}
				}
			}`);


	const functionWhileBreakVarIfB = lib.parse(`
			function hello (){
				while(true){
					break;
					if (x){
						console.log ("hello world");
					}
				}
			}`);

	assert(matchTree(functionWhileBreakVarIfA.body, functionWhileBreakVarIfB.body));

	// Test 7

	const functionWhileVarExpressiveA = lib.parse(`
		while(true){
			alert("jklajsdklf")
		}
		function goodbye()  {
			while(true){

				const  x = (function(){return 1;})();
			}

			return x;
		}`);

	const functionWhileVarExpressiveB = lib.parse(`
		while (false){console.log("alert");}

		function hola()  {
			while(false){

				const  x = (function(){return 1;})();
			}
			
			return x;
		}`);

	assert(matchTree(functionWhileVarExpressiveA.body, functionWhileVarExpressiveA.body));

	if (TEST_LONG_STR){
		assert(matchTree(lib.parse(LONG_STR).body,lib.parse(LONG_STR).body ));
		console.log("done")
	}
}

function oneTrial(){
	const start = performance.now();
	testwhiteList();
	testBlackList();
	testGeneralStructure();
	//testMatchTree();
	const end = performance.now();
	return end - start;
}

function timeIt(){

	const x = 10;

	acc = 0

	for (let i = 0; i < x ;i++){

		acc += oneTrial()
	}

	const res = acc / x;

	console.log(res)
}

oneTrial();

